    }

    function _wrap(content) {
      var len = content.length;
      var intag = false;

      for (var i=0; i<len; i++) {
        if (content[i] == '<') {
          intag = true;
          continue;
        }

        if (content[i] == '>') {
          intag = false;
          continue;
        }

        if (intag) {
          continue;
        }

